import React, { useState } from 'react';
import './StudentRegister.css'; // You can move your old style1.css here
import axios from 'axios';

function StudentRegister() {
  const [formData, setFormData] = useState({
    uname: '',
    dob: '',
    umail: '',
    uid: '',
    umobile: '',
    ugender: '',
    upassword: ''
  });

  const handleChange = (e) => {
    setFormData(prev => ({
      ...prev,
      [e.target.name]: e.target.value
    }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const res = await axios.post('http://localhost:3000/api/students/register', formData);
      alert('✅ Registration successful');
    } catch (err) {
      console.error(err);
      alert('❌ Registration failed');
    }
  };

  return (
    <div className="container">
      <header>User Registration</header>
      <form onSubmit={handleSubmit}>
        <div className="form first">
          <div className="details personal">
            <span className="title">Personal Details</span>

            <div className="fields">
              <div className="input-field">
                <label>Full Name</label>
                <input type="text" placeholder="Enter your name" name="uname" value={formData.uname} onChange={handleChange} required />
              </div>

              <div className="input-field">
                <label>Date of Birth</label>
                <input type="date" name="dob" value={formData.dob} onChange={handleChange} required />
              </div>

              <div className="input-field">
                <label>Email</label>
                <input type="email" name="umail" value={formData.umail} onChange={handleChange} required />
              </div>

              <div className="input-field">
                <label>Student ID</label>
                <input type="number" name="uid" value={formData.uid} onChange={handleChange} required />
              </div>

              <div className="input-field">
                <label>Mobile Number</label>
                <input type="number" name="umobile" value={formData.umobile} onChange={handleChange} required />
              </div>

              <div className="input-field">
                <label>Gender</label>
                <select name="ugender" value={formData.ugender} onChange={handleChange} required>
                  <option disabled value="">Select gender</option>
                  <option>Male</option>
                  <option>Female</option>
                  <option>Others</option>
                </select>
              </div>

              <div className="input-field">
                <label>Choose Password</label>
                <input type="password" name="upassword" value={formData.upassword} onChange={handleChange} required />
              </div>
            </div>
          </div>

          <button className="submit" type="submit">
            <span className="btnText">Submit</span>
          </button>
          <p>Back to <a href="/student-login">Login</a></p>
        </div>
      </form>
    </div>
  );
}

export default StudentRegister;
